/* Main Menu Slid */
var csshidenav = {
      'height' : '3px',
      'padding-top' : '0px',
	  'background-position' : 'right -55px'

    }
var cssshownav = {
      'height' : '48px',
      'padding-top' : '12px',
	  'background-position' : 'right top'
    }
$(document).scroll(function () {
        if($(window).scrollTop() >= 48){
            $('.shownav').slideDown("fast");
			$("header nav").css(csshidenav);
			$('header nav .home').show();
			$("header nav .w960, .hidenav").hide();
                        $(".selogin").hide();
        }
        if($(window).scrollTop() <= 48){
            $('.shownav, .hidenav').hide();
			$('header nav .home').hide();
			$("header nav").css(cssshownav);
			$("header nav .w960").show();
                        $(".selogin").hide();
        }
        console.log($(window).scrollTop());
    });

	    $(".shownav").click(function () {
			$("header nav").animate(cssshownav);
            $('.hidenav').slideDown("slow");
            $('.shownav').slideUp();
			$("header nav .w960").show();
        });
    $(".hidenav").click(function () {
			$("header nav").animate(csshidenav);
            $('.shownav').slideDown("slow");
            $('.hidenav').slideUp();
			$("header nav .w960").hide();
        });

    $("header nav span.login .icon").click(function () {
			$("header nav .searchnow .selogin").hide();
			$("header nav .loginnow .selogin").slideToggle("slow");
        });
    $(" header nav span.search .icon").click(function () {
			$("header nav .loginnow .selogin").hide();
			$("header nav .searchnow .selogin").slideToggle("slow");
        });
