/* cats Setup */
$('article .cats h1 .hide').click(function(){
    $(this).hide();
	$(this).parent().next('div').css("min-height","0px");
	$(this).parent().next('div').slideUp({duration: 800 , easing: 'easeOutBounce'});
    $(this).next('article .cats h1 .show').show();	
	$(this).parent().closest('article .cats h1').css("opacity", "0.5");
});
$('article .cats h1 .show').click(function(){
	$(this).parent().next('div').slideToggle({duration: 800 , easing: 'easeOutBounce'});
    $(this).hide();
    $(this).prev('article .cats h1 .hide').show();
	$(this).parent().closest('article .cats h1').css("opacity", "1");
}); 

