/* Statics */
var onlineshow = {
      'display' : 'inline-block',
    }
$("#sitestates h1 .show").click(function () {
	$("#sitestates h1 .show").hide();
	$("#sitestates h1 .hide").slideDown();
	$("#sitestates .useronline").slideDown().css(onlineshow, 60000);
	$("#sitestates .statics").slideDown().css(onlineshow, 60000);
});
$("#sitestates h1 .hide").click(function () {
	$("#sitestates h1 .hide").hide();
	$("#sitestates h1 .show").slideDown();
	$("#sitestates .useronline").slideUp();	
	$("#sitestates .statics").slideUp();	
});
